import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App.js'

ReactDOM.render(
    <React.StrictMode>
        <p>Image Background Changer</p>
        <h1 style={{color: 'red'}}>Image Background Changer</h1>
        <App />
    </React.StrictMode>,
    document.getElementById('root')
);
